	// ## base64 To Image Process ##
	public static Image base64ToImg(String base64){
		
		Image img = null;
		
        String[] strings = base64.split(",");
        
        // String exec = strings[0].substring(11, 15);
        
        byte[] data = DatatypeConverter.parseBase64Binary(strings[1]);

		try {
			
			img = ImageIO.read(new ByteArrayInputStream(data));
			
		} catch (IOException err) {
			err.printStackTrace();
		}
		
		return img;
        
	}
	
	
	public static Map<String, Color> colorPickerList = new LinkedHashMap<String, Color>();
	public static List<String> colorKeyList = new ArrayList<String>();
	
	public static List<String> getColorKeyList() {
		if(ImageObj.colorPickerList.size() < 1) ImageObj.getColorPickers();
		return colorKeyList;
	}

	public static Map<String, Color> getColorPickers(){
		if(colorPickerList.size() < 1){
			colorPickerList.put("WHITE", new Color(0,0,0,0));
			colorPickerList.put("RED", Color.RED);
			colorPickerList.put("BLUE", Color.BLUE);
			colorPickerList.put("MAGENTA", Color.MAGENTA);
			colorPickerList.put("ORANGE", Color.ORANGE);
			colorPickerList.put("GREEN", Color.GREEN);
			colorPickerList.put("BLACK", Color.BLACK);
			
			for(Map.Entry<String, Color> map : colorPickerList.entrySet()){
				colorKeyList.add(map.getKey());
			}
		}
		
		return colorPickerList;
	}
	
